import React, { Component } from 'react';
import './style.css';
import Background from './bgmoss.png';
import font from './calendar.svg';


class Praktek extends Component {
    render() {
        return (
            <div style={styles.background}>
                <div style={styles.icon}>
                    <img src={font} alt="icon" />
                </div>
                <div style={styles.text}>
                    <p style={{ alignSelf: "left" }}>Go Green</p>
                </div>
                <div style={styles.quotes}>
                    <h1 style={{ alignSelf: "center", marginLet: "60" }}>Make it green</h1>
                    <span>Now more than ever. Our planet is need our</span>
                    <div style={styles.Button}>
                        Do It Now
                        </div>
                </div>
            </div>
        );
    }
}
let h = window.innerHeight;

const styles = {
    background: {
        display: "flex",
        backgroundImage: `url(${Background})`,
        width: "100%",
        height: "100%",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
        justifyContent: "center",
        alignItem: "center",
        left: 0,
        top: 0,
        position: "absolute"
    },
    icon: {
        top: 10,
        right: 30,
        border: 3,
        height: h,
        position: "absolute"
    },
    text: {
        color: "white",
        fontFamily: "Poppins",
        top: 10,
        left: 30,
        border: 3,
        position: "absolute"
    },
    border: {
        borderStyle: "solid",
    },
    quotes: {
        justifyContent: "center",
        flexDirection: "column",
        alignItem: "center",
        color: '#FFFFFF',
        fontFamily: "Poppins",
        textAlign: "center",
        position: "absolute",
        alignSelf: "center"
    },
    Button: {
        display: "flex",
        borderRadius: 30,
        alignSelf: "center",
        marginTop: 60,
        marginLeft: 120,
        background: "#FCB371",
        fontFamily: "Poppins",
        position: "absolute",
        padding: 10
    }
}
export default Praktek;
